import React from "react";
import { FcFolder, FcFile } from "react-icons/fc";
import "./files.css";

const FileStruct = ({ data }) => {
    const renderFolders = (data) => {
        return data.map((folder, index) => (
          <div className="ItemContainer" key={index}>
            <div className="FolderIconContainer">
              <FcFolder className="FolderIcon" />
              <span className="FolderName">{folder.name}</span>
            </div>
            {folder.children && renderFolders(folder.children)}
          </div>
        ));
      };
    
      return <div className="FileComponent">{renderFolders(folders)}</div>;
};

export default FileStruct;
